pragma solidity ^0.5.6;

import "./nf-token-metadata.sol";
import "./ownable.sol";
import "./Punto0.sol";

/**
 * @dev This is an example contract implementation of NFToken with metadata extension.
 */
contract MyArtSale is
  NFTokenMetadata,
  Ownable
{

  /**
   * @dev Contract constructor. Sets metadata extension `name` and `symbol`.
   */
   uint public count;
  constructor()
    public
  {
    nftName = "Lot of Dishes";
    nftSymbol = "DSH";
  }
  function prova(string memory _nome, string memory _symbol) public{
    nftName = _nome;
    nftSymbol = _symbol;
  }

  /**
   * @dev Mints a new NFT.
   * @param _to The address that will own the minted NFT.
   * @param _tokenId of the NFT to be minted by the msg.sender.
   * @param _uri String representing RFC 3986 URI.
   */
  function mint(
    address _to,
    uint256 _tokenId,
    string calldata _uri,
    string calldata _prova

  )
    external
    onlyOwner
  {
      count++;
    super._mint(_to, count);
    super._setTokenUri(count, _uri);
    super._setTokenProva(count, _prova);
    super._addQuantity(count);

  }
    function mintAnother(
    uint256 _tokenId
  )
    external
    onlyOwner
  {
      count++;
    super._addQuantity(_tokenId);
  }


    function set_ingrediente(
    uint256 _tokenId,
    uint256 _ingrediente
  )
    external
    onlyOwner
  {
    super._setTokenIngrediente0(_tokenId, _ingrediente);
  }

     function altro(
    uint256 _ingrediente,
    address _contractAddress
  )
    external
    onlyOwner
  {
    Punto0 p = Punto0(_contractAddress);
    (uint256 a, string memory b, uint256 c, address d, uint256 e) = p.listOfIngredients(_ingrediente);

  }



}

